        if (!isSuccess) bonus = 0;
        return bonus;
    }

    function checkBonus() public constant returns (bool){
        
        return now >= (lastBonusTime[msg.sender] + 30 seconds);
    }

    //
    function join(uint amount) public returns (bool){
        require(amount < msg.sender.balance);
        transferFrom(msg.sender,gameBankAddress,amount);
        return true;
    }

    function getBalance() public constant returns (uint){
        return this.balanceOf(msg.sender);
    }    

    //
    


    struct Player{
